import Hero from "./Hero";
const Landing = () => {
  return (
    <div>
      <Hero text="Welcome to React 201" />
      <div className="container">
        <div className="row">
          <div className="col-lg-8 offset-lg-2 my-5">
            <p className="lead">
              Austin trust fund big mood lomo cornhole chambray. Selvage yuccie
              pour-over church-key wolf freegan. Disrupt marfa edison bulb, sus
              cronut kinfolk bespoke literally aesthetic craft beer semiotics
              sustainable organic gorpcore glossier. Freegan tattooed slow-carb
              pok pok tumeric la croix pop-up YOLO listicle try-hard
              chicharrones chillwave mumblecore. Distillery drinking vinegar
              iceland retro chia hexagon. Affogato normcore shoreditch
              vibecession tilde, everyday carry post-ironic pinterest photo
              booth health goth 3 wolf moon literally disrupt.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Landing;
